public class FindStarsP2Q1 {

    final int[][] matrix = {
            {1, 4, 7},
            {2, 5, 8},
            {3, 6, 9}};

    int curX = 1;
    int curY = 1;

    public static void main(String[] args) {
        FindStarsP2Q1 fs = new FindStarsP2Q1();

        String[] inputs = {"",
                "",
                "",
                "",
                ""};

        for (String input : inputs) {
            fs.parseInput(input);
        }

    }

    void parseInput(String s) {
        for (int i = 0; i < s.length(); i++) {
            switch (s.charAt(i)) {
                case 'D':
                    if (curY != 2) curY++;
                    break;
                case 'L':
                    if (curX != 0) curX--;
                    break;
                case 'R':
                    if (curX != 2) curX++;
                    break;
                case 'U':
                    if (curY != 0) curY--;
                    break;
            }
        }
        System.out.println(matrix[curX][curY]);
    }

}